import React from "react";
import AddMenuItem from "./AddMenuItem.component"
import Navbar from "../Header/Navbar"
import Footer from "../Footer/Footer"
const FinalAddMenuItem = () => {
    return (
        <>
            <Navbar />
            <AddMenuItem />
            <Footer /> 
        </>
    )
}
export default FinalAddMenuItem;
